import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 18.2-90 Entering dwelling house, etc., with intent to commit murder, rape, robbery or arson; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-90.md","filePath":"vacode/18.2-90.md"}'),o={name:"vacode/18.2-90.md"},n=a('<h1 id="§-18-2-90-entering-dwelling-house-etc-with-intent-to-commit-murder-rape-robbery-or-arson-penalty" tabindex="-1">§ 18.2-90 Entering dwelling house, etc., with intent to commit murder, rape, robbery or arson; penalty. <a class="header-anchor" href="#§-18-2-90-entering-dwelling-house-etc-with-intent-to-commit-murder-rape-robbery-or-arson-penalty" aria-label="Permalink to &quot;§ 18.2-90 Entering dwelling house, etc., with intent to commit murder, rape, robbery or arson; penalty.&quot;">​</a></h1><p>If any person in the nighttime enters without breaking or in the daytime breaks and enters or enters and conceals himself in a dwelling house or an adjoining, occupied outhouse or in the nighttime enters without breaking or at any time breaks and enters or enters and conceals himself in any building permanently affixed to realty, or any ship, vessel or river craft or any railroad car, or any automobile, truck or trailer, if such automobile, truck or trailer is used as a dwelling or place of human habitation, with intent to commit murder, rape, robbery or arson in violation of §§ <a href="http://law.lis.virginia.gov/vacode/18.2-77/" target="_blank" rel="noreferrer">18.2-77</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-79/" target="_blank" rel="noreferrer">18.2-79</a> or § <a href="http://law.lis.virginia.gov/vacode/18.2-80/" target="_blank" rel="noreferrer">18.2-80</a>, he shall be deemed guilty of statutory burglary, which offense shall be a Class 3 felony. However, if such person was armed with a deadly weapon at the time of such entry, he shall be guilty of a Class 2 felony.</p><p>Code 1950, § 18.1-88; 1960, c. 358; 1970, c. 381; 1975, cc. 14, 15; 1985, c. 110; 1992, c. 546; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0832" target="_blank" rel="noreferrer">832</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0842" target="_blank" rel="noreferrer">842</a>.</p>',3),i=[n];function l(s,c,h,d,g,m){return r(),t("div",null,i)}const f=e(o,[["render",l]]);export{u as __pageData,f as default};
